description:
Executive Assistant Iris Vol. 1

English | CBZ | 179 Pages

Genre: Action/Adventure, Spy

Written by David Wohl
Art by Eduardo Francisco

Collects Executive Assistant: Iris issues #0-6! She's a secretary, bodyguard, and assassin all rolled into one... Meet Iris, a loyal and ruthlessly efficient subordinate to her powerful, corporate boss Mr. Ching. In the modern, cutthroat corporate world, today's CEO needs an intimidating edge to stay on top, and Iris is more than well trained to oblige the demand of her employer, including murder. However, Iris discovers the man she has dutifully served for most of her life is far more corrupt than the people she is sworn to protect him from. Now torn between her loyalties to the only person she's ever served, and the new life she realizes she's ready to explore on her own, she must make a choice that could ultimately lead to her demise. Iris' treacherous journey for redemption is set in motion as the entire first volume of the critically acclaimed action-adventure series is collected here for the very first time!

